var arrCup = [103,'欧洲联赛冠军杯赛','歐洲聯賽冠軍盃賽','UEFA Champions League','欧冠杯','歐冠盃','UEFA CL','2016-2017','league_match/images/20130423213803.jpg','#f75000','&nbsp;&nbsp;&nbsp;&nbsp;参赛球队：分组赛阶段有32个名额，其中16个直接分配给卫冕球队以及15支来自欧洲最高排名的联赛冠军及亚军。欧洲足协根据多年欧洲赛事的往绩作统计数据，为欧洲各国联赛定立排名。&nbsp;截至05-06球季，欧洲九大联赛排名依次为西班牙、英格兰、意大利、法国、德国、葡萄牙、荷兰、希腊及比利时。这9国联赛冠军将直接晋身联赛冠军盃的最后卅二强，九大联赛前六位的亚军亦获此优惠。&nbsp;赛制：比赛共分8圈，包括三圈外围赛、分组赛、十六强、半准决赛、准决赛及决赛。&nbsp;三圈外围赛、十六强、半准决赛及准决赛都是以两回合淘汰赛形式，採取主客制」决胜负；若主客两回合总计入球数相同，则计算作客入球优惠，若仍未能分出胜负，则须加时再决胜负，加时并不设黄金入球或银球制，两队必须完成加时上、下半场各15分钟的赛事，加时入球较多的一队胜出，若加时入球总数相同则计算作客入球优惠，倘若加时赛互交白卷则以互射十二码分胜负。&nbsp;从外围赛晋级加上九大联赛的种子共32支球队将晋身分组赛，分组赛分成8组，每组4队，对赛6场后计算绩分，小组积分前两位的球队晋身十六强，（若出现同分，则顺序以对赛成绩、对赛得失球差、对赛作客得球、小组得失球差及小组得球等决定出线席位），而小组积分第三的球队则可以参加欧协盃第五圈赛事。&nbsp;十六强赛事将有条件地抽签分成8组以主客淘汰制形式进行，同属一国的球队不会对垒，而各小组成绩首名球队亦不会对垒。之后半准决赛及准决赛的抽签均不受上述条件限制，直至决出进入决赛的2支球队。&nbsp;决赛：决赛地点定于中立的球场举行，以确保两队均无主场优势，以一场比赛决胜负。若90分钟内打成平手，则须加时再决胜负，加时并不设黄金入球或银球制，两队必须完成加时上、下半场各15分钟的赛事，加时入球较多的一队胜出，若加时后打成平手则以互射十二码分胜负。'];
